import { motion } from "framer-motion";
import styled from "styled-components";

const NavbarCompopentsStyle = styled(motion.div)`
  position: fixed;
  top: 0;
  height: 50px;
  width: 90vw;
  padding: 0 5vw 0 5vw;
  z-index: 10000;
  font-size: 18px;
  display: flex;
  justify-content: space-between;
  align-items: center;
  background-color: #191919;
  .logo {
    width: 60%;
    font-size: 24px;
    color: #f2c14e;
    cursor: pointer;
  }
  .home,
  .home1 {
    color: #53504d;
    cursor: pointer;
  }
  .home1 {
    color: #f8f8ff;
  }
`;

const NavbarContent = [
  "home",
  "Five cols",
  "Fewer cols",
  "Templates",
  "Other pages",
];

const NavbarComponent = () => {
  return (
    <NavbarCompopentsStyle>
      <span className="logo"> DeepEnd </span>
    </NavbarCompopentsStyle>
  );
};

export default NavbarComponent;
